  \"Advanced Air Evaporation System with Reusable Wicks for Water Recovery Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T00:48:59.157642\",\n\t\"name\": \"advanced-air-evaporation-system-with-reusable-wicks-for-water-recovery-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A microgravity-compatible Advanced Air Evaporation
  System (AAES) is proposed for recovering nearly 100&#37; of water from highly contaminated
  wastewater without concern for precipitation of organic and inorganic solids.  The
  AAES incorporates reusable wicks, and heat exchange and thermoelectric heat pump
  technologies which reduce Equivalent System Mass (ESM) by lowering consumable supplies
  and energy use when compared to previous air evaporation system designs.  AAES will
  help meet the challenge of improving water loop closure in future water recycling
  systems as missions venture beyond Low-Earth Orbit (LEO), where higher fractional
  recovery of water from wastewater resources is needed.  Highly contaminated wastewater
  streams such as urine, hygiene water, and RO brines are major wastewater resource
  streams for the AAES.  The Phase I project will focus on development and characterization
  of reusable wicks.  The Phase II will incorporate heat exchange and thermoelectric
  heat pump technology into a working prototype whose performance will be thoroughly
  characterized and delivered to NASA for independent testing.  These efforts will
  increase water recovery, reduce logistics, increase reliability, and lower ESM for
  water recycling during future space missions beyond LEO.\",\n\t\"license_title\":
